import React from "react";
import brainlogo from "./logo.png";
import { LogoContainer, TiltContainer } from "./logo.styles";
const Logo = () => {
  return (
    <>
      <LogoContainer>
        <div className="Tilt-inner pa3">
          <img src={brainlogo} alt="logo" />
        </div>
      </LogoContainer>
    </>
  );
};
export default Logo;
